import React,{useState} from "react";
import "./childComponents.css";
import { useNavigate } from "react-router";

const HomeScreen = () => {

    const navigate = useNavigate();

    const handleJoinButton = (e) => {
        e.preventDefault();
        navigate("/register/");
    }

    const handleLoginButton = (e) => {
        e.preventDefault();
        navigate("/user/login/");
    }

    return (
        <>
        <div>
        <div>
        <h1 className="home-screen-top-header">Explore Jobs and <br/>Find Your Career</h1>
        </div>
        <div>
        <h1 className="home-screen-field-header">Choose your fields of interest</h1>
        <button>Engineering</button>
        <button>Engineering</button>
        <button>Engineering</button>
        <button>Engineering</button>
        <button>Engineering</button>

        </div>
        <div className="home-right-corner-button-container">
        <div>
        <button onClick={handleJoinButton} className="join-now-home-button">Join Now</button> 
        </div>
        <div>
        <button onClick={handleLoginButton} className="sign-in-home-button">Sign In</button> 
        </div>
        </div>
        </div>
        </>
    )
}

export default HomeScreen;
